    #[doc = " @cond !DOC_EXCLUDE_HEADER_SECTION"]
    #[doc = " task.h"]
    #[doc = " @code"]
    #[doc = " BaseType_t xTaskCheckForTimeOut( TimeOut_t * const pxTimeOut, TickType_t * const pxTicksToWait );"]
